import React, { Component } from 'react';

import ResponsiveDrawer from './Layout';

class IndexTutorial extends Component {
  constructor(props){
    super(props)
    this.state={

      reactTutorialIndex:[],
      reduxTutorialIndex:[]
    }


  }
  componentDidMount(){
  const ReactTutorial=  fetch('/api/react')
    .then(res=>res.json())
    .then(response=>this.setState({reactTutorialIndex:response}));

    const ReduxTutorial=  fetch('/api/redux')
      .then(res=>res.json())
      .then(response=>this.setState({reduxTutorialIndex:response}));

  }


  render() {


    return (
      <div>
        {console.log(this.props.match.path)}
        <ResponsiveDrawer tutoName="React" tutorialIndex={this.state.reactTutorialIndex} />
      </div>
    );
  }
}

export default IndexTutorial;
